func updateChapterNum(book *models.McBook) {
	//章节表
	var chapterFile string
	var err error
	_, chapterFile, err = chapter_service.GetJsonqByBookName(book.BookName, book.Author)
	if err != nil {
		global.Collectlog.Errorf("获取JSONQ对象失败 %v", err.Error())
		return
	}

	chapterAll, _, err := chapter_service.GetChapterNamesByFile(chapterFile)
	if err != nil {
		global.Collectlog.Errorf("%v", err.Error())
		return
	}
	chapterNum := len(chapterAll)
	var lastChapterTitle string
	var lastChapterId int64
	if chapterNum > 0 {
		lastChapterTitle = chapterAll[chapterNum-1].ChapterName
		lastChapterId = chapterAll[chapterNum-1].Id
	}
	data := make(map[string]interface{})
	data["chapter_num"] = chapterNum
	data["last_chapter_title"] = lastChapterTitle
	data["last_chapter_id"] = lastChapterId
	global.DB.Model(models.McBook{}).Debug().Where("id = ?", book.Id).Updates(data)
	return
}

func tjChapterFile(book *models.McBook) {
	//章节表
	var chapterFile string
	var err error
	_, chapterFile, err = chapter_service.GetJsonqByBookName(book.BookName, book.Author)
	if err != nil {
		global.Collectlog.Errorf("获取JSONQ对象失败 %v", err.Error())
		return
	}
	log.Println("bookid", book.Id)
	//err = utils.RemoveFile(chapterFile)
	//return
	chapterAll, _, err := chapter_service.GetChapterNamesByFile(chapterFile)
	if len(chapterAll) <= 0 {
		da := make(map[string]interface{})
		da["is_less"] = 1
		global.DB.Model(models.McBook{}).Where("id = ?", book.Id).Updates(da)
		return
	}
	log.Println("len", len(chapterAll))
	var isLess, LessCount int
	for _, chapter := range chapterAll {
		if chapter.ChapterName == "" || chapter.ChapterLink == "" {
			continue
		}
		var txtFile string
		_, txtFile, err = book_service.GetChapterTxtFile(book.BookName, book.Author, chapter.ChapterName)
		if utils.CheckNotExist(txtFile) {
			//global.Collectlog.Infof("章节内容文件已存在 bookName=%v author=%v chapterTitle=%v txtFile=%v ", book.BookName, book.Author, chapter.ChapterName, txtFile)
			global.Collectlog.Infof("章节内容文件不存在 bookId=%v bookName=%v author=%v chapterTitle=%v chapterLink=%v ", book.Id, book.BookName, book.Author, chapter.ChapterName, chapter.ChapterLink)
			LessCount++
			isLess = 1
		} else {
			textNum := book_service.GetTxtNum(txtFile)
			if textNum <= 1500 {
				global.Biquge34log.Infof("章节内容文件不存在 bookId=%v bookName=%v chapterTitle=%v txtFile=%v textNum=%v", book.Id, book.BookName, chapter.ChapterName, txtFile, textNum)
				return
			}
			LessCount++
			isLess = 2
		}
	}

	da := make(map[string]interface{})
	da["is_less"] = isLess
	da["less_count"] = LessCount
	da["chapter_num"] = len(chapterAll)
	global.DB.Model(models.McBook{}).Debug().Where("id = ?", book.Id).Updates(da)
	return
}

func getChapters1(bookUrl string) (chapters []*models.CollectChapterInfo, err error) {
	var html string
	html, err = utils.GetHtml(bookUrl, "utf-8", 1, 0)
	if html == "" {
		err = fmt.Errorf("采集内容为空%v", err.Error())
		return
	}
	if html == "" {
		time.Sleep(time.Second)
		return
	}
	document, err := goquery.NewDocumentFromReader(strings.NewReader(html))
	if err != nil {
		err = fmt.Errorf("goquery err=%v", err.Error())
		return
	}
	// 选择包含章节信息的 dl 元素
	dl := document.Find("#list dl")
	// 查找包含 "正文" 字样的 dt 标签
	dt := dl.Find("dt:contains('正文')")
	// 获取该 dt 标签下面的所有 dd 标签
	dd := dt.NextAllFiltered("dd")
	// 遍历 dd 标签并获取链接和标题信息
	dd.Each(func(i int, selection *goquery.Selection) {
		link := selection.Find("a").AttrOr("href", "")
		title := selection.Find("a").Text()
		chapter := &models.CollectChapterInfo{
			ChapterTitle: title,
			ChapterLink:  link,
		}
		chapters = append(chapters, chapter)
	})
	return
}

